import { React } from 'react';

export const MatchDetailCard = ({match}) => {
  if(!match) return null;
  const otherTeam = match.team1 === match.teamName ? match.team2 : match.team1;
  return (
    <div className="MatchDetailCard">
    <h4>vs {otherTeam}</h4>
    </div>
  );
}
